import React from "react";

const FriendCard = (props) => {
  return (
    <li>
      <div>
        <p>id</p>
        <h3>name</h3>
        <p>email</p>
        <p>birthday</p>
        <p>city</p>
      </div>
    </li>
  );
};

export default FriendCard;
